import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";
import "./Profile.css"; // Add styling

const Profile = () => {
  const navigate = useNavigate();
  const [user, setUser] = useState(null);
  const [bookings, setBookings] = useState([]);

  useEffect(() => {
    const token = localStorage.getItem("token");
    if (!token) {
      navigate("/login"); // Redirect if no token
      return;
    }

    axios.get("http://localhost:5000/api/user/profile", {
      headers: { Authorization: `Bearer ${token}` }
    })
      .then(response => {
        setUser(response.data);
      })
      .catch(error => {
        console.error("Error fetching profile:", error);
        localStorage.removeItem("token"); // Remove invalid token
        navigate("/login");
      });

    axios.get("http://localhost:5000/api/user/bookings", {
      headers: { Authorization: `Bearer ${token}` }
    })
      .then(response => {
        setBookings(response.data);
      })
      .catch(error => {
        console.error("Error fetching bookings:", error);
      });

  }, [navigate]);

  if (!user) return <p>Loading profile...</p>;

  return (
    <div className="profile-container">
      <h1>Welcome, {user.username}</h1>

      {/* Personal Info Section */}
      <section className="profile-section">
        <h2>Personal Information</h2>
        <p><strong>Email:</strong> {user.email}</p>
        <p><strong>Phone:</strong> {user.phone || "Not provided"}</p>
        <p><strong>Role:</strong> {user.role}</p>
        <button onClick={() => navigate("/reset-password")}>Reset Password</button>
      </section>

      {/* Booking Details Section */}
      <section className="profile-section">
        <h2>Booking Details</h2>
        <h3>Current Bookings</h3>
        {bookings.length > 0 && bookings.some(b => b.status === "upcoming") ? (
          bookings.filter(b => b.status === "upcoming").map(booking => (
            <div key={booking.id} className="booking-card">
              <p><strong>Service:</strong> {booking.service}</p>
              <p><strong>Date:</strong> {booking.date}</p>
              <p><strong>Status:</strong> {booking.status}</p>
            </div>
          ))
        ) : <p>No upcoming bookings.</p>}

        <h3>Previous Bookings</h3>
        {bookings.length > 0 && bookings.some(b => b.status === "completed") ? (
          bookings.filter(b => b.status === "completed").map(booking => (
            <div key={booking.id} className="booking-card past">
              <p><strong>Service:</strong> {booking.service}</p>
              <p><strong>Date:</strong> {booking.date}</p>
              <p><strong>Status:</strong> {booking.status}</p>
            </div>
          ))
        ) : <p>No past bookings.</p>}
      </section>

      {/* Other Necessary Info */}
      <section className="profile-section">
        <h2>Account Settings</h2>
        <button onClick={() => navigate("/payment-history")}>View Payment History</button>
        <button onClick={() => {
          localStorage.removeItem("token");
          navigate("/login");
        }}>Logout</button>
      </section>
    </div>
  );
};

export default Profile;
